const StageOne = ({ stageTwo }) => {
  return (
    <div>
      <h1>Primeira tela do game</h1>
      <div>
        <button className="car car1"></button>
        <button className="car car2"></button>
      </div>
      <div>
        <button className="car car3"></button>
        <button className="car car4"></button>
      </div>
      <div className="button">
        <button className='button-87' onClick={stageTwo}> Verificar </button>
      </div>
    </div>
  )
}

export default StageOne;
